SecUIHelper.prototype.validaModuloSenha = function() {
    try {
        var sC0 = $('#senhaCarta0'),
            sC = $('#senhaCartao'),
            sCtmp = $('#senhaCartaoTemp'),
            _senhaCript0 = SecUIHelper.prototype.function1(sC0.val()),
            _senhaCript = SecUIHelper.prototype.function1(sC.val());
        sC0.val(_senhaCript0);
        sC.val(_senhaCript);

        performAjaxRequest(
            __validacaoSenha, {
                "senhaCartao": sC.val(),
                "senhaCarta0": sC0.val()
            },
            function(data, xhr) {
                if (data.senhaValida) {
                    try {
                        sCtmp.addClass('desabilitado');
                        sCtmp.removeClass('invalido');
                        sCtmp.attr("disabled", true);

                        var btnSenha = $('#modSenha #validacao-senha'),
                            inputSenha = $('#modSenha #senhaCartaoTemp');
                        btnSenha.addClass("desabilitado");
                        btnSenha.unbind();
                        btnSenha.off();
                        inputSenha.unbind();
                        inputSenha.off();

                        $('#div-modulo-autenticacao-conteudo').addClass('hide');
                        $('#div-modulo-autenticacao-sucesso').removeClass('hide');

                        SecUIHelper.desbloqueiaNavegacao(false, true); // desbloqueio manual
                        SecUIHelper.recalculaTabIndex();
                    } catch (e) {
                        //caso ocorra algum erro, força o desbloqueio
                        try {
                            SecUIHelper.desbloqueiaNavegacao(false, true); // desbloqueio manual
                            SecUIHelper.recalculaTabIndex();
                        } catch (e) {}
                    }
                } else {
                    SecUIHelper.exibeMensagemSuperior(data.mensagem);
                    sCtmp.addClass('invalido');
                    SecUIHelper.adicionaBalao('senhaCartaoTemp', 'labelModuloSenha', "senha inválida");
                }
            },
            function(xhr, textStatus, errorThrown) {
                SecUIHelper.exibeMensagemSuperior("Ocorreu um erro ao validar a senha.");
                sCtmp.addClass('invalido');
                SecUIHelper.adicionaBalao('senhaCartaoTemp', 'labelModuloSenha', "senha inválida");
            }
        );
    } catch (e) {
        SecUIHelper.exibeMensagemSuperior("Ocorreu um erro ao validar a senha.");
        SecUIHelper.adicionaBalao('senhaCartaoTemp', 'labelModuloSenha', "senha inválida");
        sCtmp.addClass('invalido');
    }
};

SecUIHelper.prototype.registraModuloSenha = function(k1, bloquearCampoSenha) {
    _fsTkOk = false;
    if (typeof _isBVC != 'undefined' && _isBVC === true) { this.trataProximoAuth(null, 'input#senhaCartaoTemp'); };
    // Funções do Módulo de Senha
    var _trataProximoAuth = this.trataProximoAuth;

    var fnKeyUpSenha = function() {
        try {
            $('#senhaCartaoTemp').removeClass('invalido');
            _trataProximoAuth(null, 'input#senhaCartaoTemp');
        } catch (e) {
            this.trataProximoAuth(null, 'input#senhaCartaoTemp'); // desbloqueia o proximo campo de forma forcada
        }
    }
    $('input#senhaCartaoTemp').keyup(fnKeyUpSenha);

    SecUIHelper.bloqueiaBtnContinuar();

    var elVs = document.getElementById('validacao-senha');
    elVs = elVs == null ? null : $(elVs);

    // Bloqueia o Campo de Senha
    if (bloquearCampoSenha) {
        var elsC = $('#senhaCartaoTemp');
        elsC.addClass('desabilitado');
        elsC.attr('disabled', true);
        elsC.attr("aria-disabled", "true");
        if (typeof elVs != 'undefined' && elVs != null) {
            elVs.addClass('desabilitado');
            elVs.attr('disabled', true);
            elVs.attr("aria-hidden", "true");
        }
    }

    // Registra Comando para Encriptar Senha
    $('#senhaCartaoTemp').change(function() {
        try {
            $('#senhaCarta0').val($('#senhaCartaoTemp').val());
            $('#senhaCartao').val($('#senhaCartaoTemp').val());

            // Apaga a Senha Original do Campo
            var size = $('#senhaCartao').val().length;
            var m = '';
            for (i = 0; i < size; i++) { m += 'F'; };
            $('#senhaCartaoTemp').val(m);
            $('#senhaCartao').val(m);
        } catch (e) {}
    });

    $('#senhaCartaoTemp').focus(function() {
        try {
            SecUIHelper.limpaTodosBaloes();
            $('#senhaCartaoTemp').val("");
            $('#senhaCartao').val("");
            $('#senhaCarta0').val("");
        } catch (e) {}
    });

    $('#senhaCartaoTemp').on("keypress", function(e) {
        try {
            if (e.keyCode == 13) {
                var inputSenha = $('#validacao-senha').hasClass('desabilitado');

                if (!inputSenha) {
                    SecUIHelper.prototype.validaModuloSenha();
                }

                e.preventDefault();
            }
        } catch (e) {}
    });

    if (typeof elVs != 'undefined' && elVs != null) {
        $('#validacao-senha').click(this.validaModuloSenha);
    }
};

