// Desbloqueia o Processo da Tela
SecUIHelper.desbloqueiaNavegacao = function(automatico, forceUnlock) {
    try {
        SecUIHelper.desbloqNavegSemExecAut(forceUnlock);
        var campoSenha = $('#senhaCartaoTemp');
        var isInputCampoSenha = campoSenha.is('input');
        var forceUnlock = (typeof forceUnlock === 'boolean' && forceUnlock === true);
        var naoAutomatico = (typeof automatico === 'boolean' && automatico === false);
        if (forceUnlock) { // força a liberacao automatica independente da restricao de senha
            isInputCampoSenha = false;
        }
        if (!naoAutomatico // para rodar nao pode ter a flag que desabilita a execucao automatica
            &&
            !isInputCampoSenha) { // para rodar nao pode ter um input senha na tela
            // Click Automático Botão Continuar
            setTimeout("(function btnr(){var href=document.getElementById('btn-continuar').href;href=href.replace( new RegExp('\\javascript:','gm'),'');eval(href);})();", 500);
        }
    } catch (e) {}
}

// executa o desbloqueio do botao sem acionar o botao continuar de forma automatica
SecUIHelper.desbloqNavegSemExecAut = function(forceUnlock) {
    // Limpa Mensagem Superior e Inferior
    SecUIHelper.escondeMensagemSuperior();
    SecUIHelper.escondeMensagemErroInferior();

    var campoSenha = $('#senhaCartaoTemp');
    var forceUnlock = (typeof forceUnlock === 'boolean' && forceUnlock === true);

    if (campoSenha.is('input') // Se Existir, Habilita
        &&
        !forceUnlock) { // se tiver um force, habilita o botao continuar indepedente de outras restricoes
        $('#senhaCartaoTemp').removeClass('desabilitado');
        $('#senhaCartaoTemp').removeAttr('disabled');
        $('#senhaCartaoTemp').attr("aria-disabled", "false");
        $('#senhaCartaoTemp').val('');
        $('#senhaCartaoTemp').focus();
    } else { // Se não, Habilita o Botão Continuar

        // Não tem Campo senha... Então desbloqueia o Botão Continuar
        $('#btn-continuar').removeClass('desabilitado');
        $('#btn-continuar').removeAttr('disabled');
        $('#btn-continuar').attr("aria-hidden", "false");
        SecUIHelper.recalculaTabIndex();
    }
}

