// Reseta o Modo de Desbloqueio do Token SMS
SecUIHelper.resetaModoDesbloqueioTokenSMS = function() {

    // Toda vez que o Botão for usado, reseta o Controle de Fluxo do SMS
    __smsModoDesbloqueio = false;
    __smsModoDesbloqueioCodigoI = "";
    __smsModoDesbloqueioCodigoII = "";

};

// Realiza Chamada AJAX para Validação do SMS
SecUIHelper.prototype.validaSMS = function() {

    // Limpa os Balões
    SecUIHelper.limpaTodosBaloes();
    try { $('#msg-tokensms > div').addClass('hide'); } catch (e) {}

    var keyField = $('#sms-codigoRecebido');
    validation = SecUIHelper.verificaTamanhoCampo(keyField);
    if (validation.isPasswordField &&
        validation.containsMaxLength &&
        validation.fieldDataLen >= validation.maxLength) {} else {
        SecUIHelper.adicionaBalao('sms-codigoRecebido', 'labelCodigoDispSMS', "código inválido");
        return;
    }
  
    /* Verifica se o Token está em Modo de Desbloqueio */
    if (__smsModoDesbloqueio) { // Modo de Desbloqueio

        // Seta Valor e Troca Mensagem
        if (__smsModoDesbloqueioCodigoI == "") {

            // Seta Valor
            __smsModoDesbloqueioCodigoI = keyField.val();

            // Exibe Mensagem
            SecUIHelper.exibeMensagemSuperior("Primeiro código: " + __smsModoDesbloqueioCodigoI + ". Digite o próximo código.");

            // Esconde o Envio do SMS
            $('#sms-confirmacao').addClass('hide');

            // Limpa Campo
            keyField.val("");

            // Seta Foco
            keyField.focus();
        } else if (__smsModoDesbloqueioCodigoII == "") {

            // Seta Valor
            __smsModoDesbloqueioCodigoII = keyField.val();

            // Executa Ajax
            performAjaxRequest(__smsValidOP, {
                'token': this.function1(__smsModoDesbloqueioCodigoI),
                'nextToken': this.function1(__smsModoDesbloqueioCodigoII)
            }, this.validaSMSOK, this.validaSMSErro);

            // Reseta o Modo de Desbloqueio
            SecUIHelper.resetaModoDesbloqueioTokenSMS();
        }
    } else { // Modo Normal (Não Bloqueado)

        // Executa Ajax
        performAjaxRequest(__smsValidOP, {
            'token': this.function1(keyField.val())
        }, this.validaSMSOK, this.validaSMSErro);
    }
};

SecUIHelper.exibeMensagemTokenSMS = function(mensagem) {

    // Exibe Área da Mensagem 
    $('#sms-validado').removeClass('hide');

    // Troca a Mensagem
    $('#sms-validado').find('p').html('<strong>' + new SecUIHelper().decodeData(mensagem) + '</strong>');
};


// Handler para quando a Validação do SMS foi bem Sucedida
SecUIHelper.prototype.validaSMSOK = function(data, xhr) {
    clearTimeout(SecUIHelper.initTimeout);

    //if (!$("#ura-confirmacao").hasClass("hide")) {
    //    $("#ura-confirmacao").addClass("hide");
    //    $('#ura-finalizada').removeClass('hide');
    //}

    // Seta Flag de COntrole da URA
    SecUIHelper.tokenSmsValidado = true;

    // Esconde a Mensagem de Confirmação de Envio
    $('#sms-confirmacao').addClass('hide');

    // Limpa o Campo com o Código do Token
    $('#sms-codigoRecebido').val("");

    if (data.sucesso) {

        if (data.tokenValido) { // Fluxo para Token Válido

            //Esconde as mensagens do Token URA
            SecUIHelper.escondeMensagemURA();
			
			  //Desbloqueia o teclado 
            $('#token-teclado').addClass("block");

            //Remover mensagem de alerta
            if($('.box-info').css('display') != 'none') $('.box-info').hide();

            // Esconde Todos os Outros Elementos
            $('#sms-gerarCodigo').css('display', 'none');
            $('#escolheDispositivo').css('display', 'none');
            $('#sms-codigoRecebidoOk').css('display', 'none');
            $('#sms-codigoOk').css('display', 'none');

            // Esconde a Área de Seleção de Dispositivos
            SecUIHelper.escondeAreaSelecaoDispositivos();

            // Esconde a Áreas do Conteúdo do SMS (Menos a Mensagem)
            var childrens = $('#content-sms').children().children();
            var size = childrens.length;
            for (i = 0; i <= (size); i++) {
                var o = $(childrens[i]);
                if (o != null) {
                    $(childrens[i]).addClass('hide');
                }
            }

            // Esconde a Mensagem Inferior do SMS
            $('#sms-mensagem').addClass('hide');
            $('#sms-confirmacao').addClass('hide');

            // Exibe Área da Mensagem 
            SecUIHelper.exibeMensagemTokenSMS(data.message);

            // Desbloqueia a Navegação
            SecUIHelper.desbloqueiaNavegacao();

            // Chamada analytics Token SMS Valido 
            try {
                if (__smsModoDesbloqueio) {
                    $anSec.crAn_itokenSMSDesbloqueado();
                } else {
                    $anSec.crAn_itokenSMSConcluido();
                }
            } catch (e) {}

        } else if (data.tokenValidoInformarNovoCodigo) { // Fluxo para Token Válido e Necessita Próximo Código

            // Mensagem
            SecUIHelper.exibeMensagemSuperior(data.message);

            // Foco no campo
            $('#sms-codigoRecebido').focus();

            // Seta Modo de Desbloqueio do Token
            SecUIHelper.resetaModoDesbloqueioTokenSMS();
            __smsModoDesbloqueio = true;

            $('.modulo-autenticacao .btn-fluxo#sms-gerarCodigo').trigger("click");

            // Chamada analytics Token SMS Bloqueado
            try {
                $anSec.crAn_bloqueioitokenSMS();
            } catch (e) {}


        } else { // Fluxo para Token Inválido
            
            // Adiciona Balão de Mensagem
            SecUIHelper.adicionaBalao('sms-codigoRecebido', 'labelCodigoDispSMS', data.message);
            SecUIHelper.escondeMensagemSuperior();
            SecUIHelper.resetaModoDesbloqueioTokenSMS();

            // Foco no campo
            $('#sms-codigoRecebido').val('');
            $('#sms-codigoRecebido').focus();
            $('#sms-gerarCodigo').removeClass('desabilitado');
            SecUIHelper.zeraTabIndex([$('#sms-gerarCodigo')]);
            
			// Chamada analytics Token SMS Invalido
			try {
				$anSec.crAn_itokenSMSInvalido();
			} catch (e) {}
		
        }
    } else if(!data.sucesso && !data.tokenValido && data.bloqueioTransacao){
    	SecUIHelper.getTelaBloqueioIToken();
    } else {
        SecUIHelper.resetSMS();

        // Troca a Mensagem
        $('#sms-mensagem').find('p').text(new SecUIHelper().decodeData(data.message));

        setTimeout(function() {
            // Exibe a Mensagem
            $('#sms-mensagem').removeClass('hide');
        }, 500);


    }
};

SecUIHelper.resetSMS = function() {
    // Reseta o Estado da UI para o Momento antes do Cliente Clicar no Botão GERAR
    var o = $('input#sms-codigoRecebido');
    if (o != null) {
        o.val('');
        o.attr('disabled', true);
        o.attr('aria-disabled', "true");
    };
    // Reseta o estado do botao
    o = $('#sms-codigoOk');
    if (o != null) {
        o.addClass('desabilitado');
        o.attr("aria-hidden", "true");
        SecUIHelper.zeraTabIndex([o]);
    };
};

