/* Reseta o Fluxo de Desbloqueio do Token APP */
SecUIHelper.resetaModoDesbloqueioTokenApp = function() {
    __appModoDesbloqueio = false;
    __appModoDesbloqueioCodigoI = "";
    __appModoDesbloqueioCodigoII = "";
};


// Funções de Apoio para Validação de APP
SecUIHelper.exibeMensagemTokenAPP = function(mensagem) {

    // Exibe Área da Mensagem 
    $('#app-confirmacao').removeClass('hide');

    // Troca a Mensagem
    $('#app-confirmacao').find('p').html('<strong>' + new SecUIHelper().decodeData(mensagem) + '</strong>');

};

//Realiza Chamada AJAX para Validação do Token Aplicativo
SecUIHelper.prototype.validaTokenAPP = function() {

    // Limpa os Balões
    SecUIHelper.limpaTodosBaloes();

    var keyField = $('#app-entraCodigo');
    validation = SecUIHelper.verificaTamanhoCampo(keyField);
    if (validation.isPasswordField &&
        validation.containsMaxLength &&
        validation.fieldDataLen >= validation.maxLength) {} else {
        SecUIHelper.adicionaBalao('app-entraCodigo', 'labelCodigoDispApp', "código inválido");
        return;
    }

    /* Bloqueia Área de Mensagens de Erro */
    $('#app-erro').addClass('hide');

    /* Verifica se o Token está em Modo de Desbloqueio */
    if (__appModoDesbloqueio) { // Modo de Desbloqueio

        // Seta Valor e Troca Mensagem
        if (__appModoDesbloqueioCodigoI == "") {

            // Seta Valor
            __appModoDesbloqueioCodigoI = keyField.val();

            // Exibe Mensagem
            SecUIHelper.exibeMensagemSuperior("Primeiro código: " + __appModoDesbloqueioCodigoI + ". Digite o próximo código.");

            // Limpa Campo
            keyField.val("");

            // Seta Foco
            keyField.focus();
        } else if (__appModoDesbloqueioCodigoII == "") { // Preenche o Código 2 e Envia
            __appModoDesbloqueioCodigoII = keyField.val();

            // Executa Ajax
            performAjaxRequest(__appValidOP, {
                'token': this.function1(__appModoDesbloqueioCodigoI),
                'nextToken': this.function1(__appModoDesbloqueioCodigoII)
            }, this.validaTokenAPPOK, this.validaTokenAPPErro);

            SecUIHelper.resetaModoDesbloqueioTokenApp();
        }

    } else { // Modo Normal (Não Bloqueado)
        // Executa Ajax
        performAjaxRequest(__appValidOP, {
                'token': this.function1(keyField.val())
            },
            this.validaTokenAPPOK,
            this.validaTokenAPPErro
        );
    }
};


//Handler para quando a Validação do APP foi bem Sucedida
SecUIHelper.prototype.validaTokenAPPOK = function(data, xhr) {

    // Limpa o Campo com o Código do Token
    $('#app-entraCodigo').val("");

    if (data.sucesso) {

        if (data.tokenValido) { // Fluxo para Token Válido
            var childrens = $('#content-app').children();
            var size = childrens.length;
            for (i = 0; i < (size - 1); i++) {
                $(childrens[i]).addClass('hide');
            }
			
			 //Desbloqueia o teclado 
            $('#token-teclado').addClass("block");

            //Remover mensagem de alerta
            if($('.box-info').css('display') != 'none') $('.box-info').hide();

            // Mensagem
            SecUIHelper.exibeMensagemTokenAPP(data.message);

            // Esconde a Área de Seleção de Dispositivos
            SecUIHelper.escondeAreaSelecaoDispositivos();

            // Desbloqueia a Navegação
            SecUIHelper.desbloqueiaNavegacao();

            // Chamada analytics Token Fisico Concluido
            try {
                if (__appModoDesbloqueio) {
                    $anSec.crAn_itokenAplicativoDesbloqueado();
                } else {
                    $anSec.crAn_itokenAplicativoConcluido();
                }
            } catch (e) {}

        } else if (data.tokenValidoInformarNovoCodigo) { // Fluxo para Token Válido e Necessita Próximo Código

            // Mensagem
            SecUIHelper.exibeMensagemSuperior(data.message);

            // Foco no campo
            $('#app-entraCodigo').focus();

            // Seta Modo de Desbloqueio do Token
            __appModoDesbloqueio = true;

            // Chamada analytics Token Fisico Bloqueado
            try {
                $anSec.crAn_bloqueioitokenAplicativo();
            } catch (e) {}

        } else { // Fluxo para Token Inválido

            // Adiciona Balão de Mensagem
            SecUIHelper.adicionaBalao('app-entraCodigo', 'labelCodigoDispApp', data.message);

            SecUIHelper.escondeMensagemSuperior();
            SecUIHelper.resetaModoDesbloqueioTokenApp();

            // Foco no campo
            $('#app-entraCodigo').focus();

            // Chamada analytics Token Fisico Concluido
			try {
				$anSec.crAn_itokenAplicativoInvalido();
			} catch (e) {}

        }
   	} else if(!data.sucesso && data.desativado){
		SecUIHelper.getTokenDesativado();
	}else if(!data.sucesso && !data.tokenValido && data.bloqueioTransacao){
    	SecUIHelper.getTelaBloqueioIToken();
    } else {

        SecUIHelper.exibeMensagemErroInferior(data.message);
    }

};

//Handler para quando a Validação do SMS apresentou Erro
SecUIHelper.prototype.validaTokenAPPErro = function(xhr, textStatus, errorThrown) {
    SecUIHelper.exibeMensagemErroInferior("Problemas na Validação");
};


