function gerarMensagem(objPlugin, sVersao, sID) {
    var ID = "";
    var ID2 = "";
    var OSV = "";
    var VERSAO = "";
    var PLV;
    var IP = "";
    var ISVM = "";
    //Grava informações
    try {
        objPlugin.Function5(gAgencia,
            gConta,
            gTitular,
            gTU);
    } catch (err) {}

    try {
        PLV = objPlugin.Versao;
        if ((PLV == undefined) || (PLV.indexOf("function") != -1)) { PLV = ""; }
    } catch (erro) { PLV = ""; }

    //Os campos concatenados antes dessa mensagem (antes do campo |2=): 3|3=30|6=|7=|8=|32=,
    //	são inseridos no servidor

    try { OSV = "|35=" + objPlugin.Info("OSV"); } catch (erro) { OSV = "|35="; }
    try { VERSAO = "|36=" + sVersao + objPlugin.Info(sVersao + "V"); if (VERSAO[VERSAO.length - 1] == "\0") { VERSAO = VERSAO.substring(0, VERSAO.length - 1); } } catch (erro) { VERSAO = "|36="; }
    if (sID != "") {
        try { ID = objPlugin.Digest(sID).toString(); } catch (erro) { ID = "00000000"; }
        try { ID2 = "|28=" + objPlugin.Digest2(sID).toString(); } catch (erro) { ID2 = "00000000"; }
    } else {
        try { ID = objPlugin.Digest("").toString(); } catch (erro) { ID = "00000000"; }
        try { ID2 = "|28=" + objPlugin.Digest2("").toString(); } catch (erro) { ID2 = "00000000"; }
    }
    try { ISVM = "|56=" + objPlugin.Info("isvm"); } catch (erro) { ISVM = "|56=2"; }
    var strLogDados = "|2=" + PLV + "|1=" + ID + ID2 + OSV + VERSAO + ISVM;

    return strLogDados;
}

